def findlocation(routearr, distanceremaining):

    low = 0
    high = len(routearr) - 1
    resultindex = -1

    while low <= high:
        mid  = low + (high - low)//2

        if routearr[mid][0] < distanceremaining:
            resultindex = mid
            low = mid + 1

        else:
            high = mid - 1

